import{_ as e,o as a,c as t,V as r}from"./chunks/framework.b2940161.js";const w=JSON.parse('{"title":"每周分享（第 13 期）：周刊为什么只谈技术？","description":"","frontmatter":{},"headers":[],"relativePath":"ruanyifeng/weekly/issue-13.md","filePath":"ruanyifeng/weekly/issue-13.md","lastUpdated":1690332621000}'),p={name:"ruanyifeng/weekly/issue-13.md"},o=r('<h1 id="每周分享-第-13-期-周刊为什么只谈技术" tabindex="-1">每周分享（第 13 期）：周刊为什么只谈技术？ <a class="header-anchor" href="#每周分享-第-13-期-周刊为什么只谈技术" aria-label="Permalink to &quot;每周分享（第 13 期）：周刊为什么只谈技术？&quot;">​</a></h1><p>这里记录过去一周，我看到的值得分享的东西，每周五发布。</p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071301.jpg" alt=""></p><p>（题图：武林门码头，杭州，2017）</p><h2 id="本周话题-周刊为什么只谈技术" tabindex="-1">本周话题：周刊为什么只谈技术？ <a class="header-anchor" href="#本周话题-周刊为什么只谈技术" aria-label="Permalink to &quot;本周话题：周刊为什么只谈技术？&quot;">​</a></h2><p>自从我<a href="http://www.ruanyifeng.com/blog/2018/07/my-books.html" target="_blank" rel="noreferrer">认定</a>，未来二三十年，人类社会将有天翻地覆的大变。我的所有时间，就都投在技术领域了。因为变化是技术引起的，只有了解技术，才可能应对变化。</p><p>我相信，未来最大的那些机会，一定是技术带来的机会。底层的年轻人要想翻身，当工程师是比较可能的途径。当然，医生和律师依然可以赚钱，但我觉得前景不如工程师，因为将来一定是机器帮你看病，帮你打官司。</p><p>这个《每周分享》系列只谈技术的原因就在这里，因为其他东西没有那么重要。</p><h2 id="新闻" tabindex="-1">新闻 <a class="header-anchor" href="#新闻" aria-label="Permalink to &quot;新闻&quot;">​</a></h2><p>1、<a href="https://wallstreetcn.com/articles/3342834" target="_blank" rel="noreferrer">Intel 公司解雇 CEO</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071302.jpg" alt=""></p><p>Intel 宣布与 CEO 解除合同，表面理由是他与女员工谈恋爱。但背后原因是这十年来，Intel 的新产品乏善可陈，PC 端止步不前，移动端完全败北，新兴的 AI 计算市场输给了 Nvidia。</p><p>2、<a href="http://finance.sina.com.cn/stock/usstock/c/2018-06-29/doc-iheqpwqz0414337.shtml" target="_blank" rel="noreferrer">日本就业率创新高</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071303.jpg" alt=""></p><p>由于日本人口不断萎缩，劳动力短缺，就业率变得极高。2018年5月，就业人数达到6698万人，是1953年以来的新高。应届大学生的就业率，达到前所未有的98%，进入了大学毕业生几乎人人都能找到工作的&quot;完全就业&quot;时代，学生对企业的招聘会也失去参加热情。另外，女性就业和65岁以上的老人就业也增加非常多。</p><p>由于工作太容易找，日本人强调的对企业的忠诚和终身就业都在减少，员工入职后很快就辞职的现象不断增加，企业如何挽留人才成为重要课题。</p><p>另一个相关的新闻是，6月15日，日本政府<a href="https://www.thepaper.cn/newsDetail_forward_2199916" target="_blank" rel="noreferrer">宣布</a>在2025年以前引进50万外籍劳工，但只限于五个领域：农业、社会护理业、建筑业、酒店业和造船业。估计以后会不断放宽外国人就业，作为日本的主要邻国，中国青年去日本就业必将越来越多。</p><p>3、<a href="https://www.theverge.com/2018/7/1/17521456/500px-marketplace-creative-commons-getty-images-visual-china-group-photography-open-access" target="_blank" rel="noreferrer">500px 取消照片共享授权</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071304.jpg" alt=""></p><p>著名的照片网站 500px 宣布，不再允许用户发布照片时，使用创意共享许可证。也就是说，它上面的照片默认无法再免费使用了，必须单独联系作者，获得授权。值得一提的是，该网站不久前刚被北京的视觉中国集团收购。</p><p>目前，已经有人声称，将在三天内将该网站原有的共享照片，全部下载下来，大小大约是3TB。</p><p>4、<a href="https://theconversation.com/how-we-discovered-three-poisonous-books-in-our-university-library-98358" target="_blank" rel="noreferrer">涂上毒药的书籍</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071305.jpg" alt=""></p><p>意大利历史小说《玫瑰之名》，讲述了一个恐怖故事。中世纪时，有人为了防止异端邪说传播，为某些书籍涂上了毒药，由于那时的僧侣有沾唾液翻书的习惯，读久了就会中毒身亡。</p><p>南丹麦大学对图书馆的古书进行 X 光分析，发现真有三本这样的古书，页面涂上了砷，不知道曾经毒死了多少人。</p><p>5、<a href="https://itsfoss.com/suse-eqt-acquisition/amp/" target="_blank" rel="noreferrer">OpenSUSE 被收购</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071306.jpg" alt=""></p><p>Linux 发行版 OpenSUSE 的母公司被收购了，价格是25亿美元。 这家公司所有产品全部开源，只对服务收费，所以不要再认为开源赚不了钱。</p><p>6、<a href="https://www.nhs.uk/news/lifestyle-and-exercise/short-sightedness-linked-longer-time-spent-education/" target="_blank" rel="noreferrer">近视与读书时间正相关</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071307.jpg" alt=""></p><p>英国一项研究发现，儿童每天读书时间越长，患上近视的可能性越高。我国城市学生的近视发病率达到90%，十个孩子里面有九个是近视，这说明中国的教育方式有问题，孩子读书时间过长是近视人口超多的主要原因。</p><p>7、<a href="https://mail.python.org/pipermail/python-committers/2018-July/005664.html" target="_blank" rel="noreferrer">Python 创始人放弃决策权</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071308.jpg" alt=""></p><p>Python 语言的创始人和最高决策者 Guido van Rossum，由于他主导的提案 PEP572 被社区反对，今天宣布非常疲倦，将不再执行最高决策者的角色。 但是，他没说接下来怎么决策，只说以后你们自己讨论决定。</p><p>8、<a href="https://wiki.gentoo.org/wiki/Github/2018-06-28" target="_blank" rel="noreferrer">Gentoo 的 GitHub 账户被黑</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071309.jpg" alt=""></p><p>6月底，有人拿到 Linux 发行版 Gentoo 的 GitHub 管理员权限，然后把密码改了，其他管理员都删了，在应用程序的源码里面加入 rm -rf 。虽然，GitHub 官方已经处理这件事情，但是看了也是一身冷汗。万一真的以 root 权限运行，莫名其妙你的系统就全没了。</p><p>9、<a href="https://news.crunchbase.com/news/in-q2-2018-global-vc-scales-tipped-in-favor-chinese-startups-over-north-america/" target="_blank" rel="noreferrer">二季度的中国风险投资金额高于美国</a></p><p>据统计，今年二季度，中国的创业公司获得的风险投资高于美国。主要原因是，6月份蚂蚁金服完成了C轮融资，获得了140亿美元，是有史以来最大的风险投资。</p><p>另外，二季度中国的风险投资笔数是去年同期的395%。这说明，中国已经成为世界上最容易获得风险投资的地方。</p><h2 id="教程" tabindex="-1">教程 <a class="header-anchor" href="#教程" aria-label="Permalink to &quot;教程&quot;">​</a></h2><p>1、<a href="https://www.smashingmagazine.com/2018/06/google-flutter-mobile-development/" target="_blank" rel="noreferrer">Flutter 入门介绍</a>（英文）</p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071310.jpg" alt=""></p><p>现在的跨平台App开发工具分成两类：（1）容器包了Web View，App实际是一个本地网站；（2）原生控件的跨平台抽象。Flutter走了不一样的路：自己开发了一套原生控件，每个平台实现一遍，然后把渲染引擎（这套控件）打包在每个应用里面，因此性能没有问题，平台差异也很小。</p><p>2、<a href="https://www.bernat.tech/the-state-of-type-hints-in-python/" target="_blank" rel="noreferrer">Python 类型系统的现状</a>（英文）</p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071311.jpg" alt=""></p><p>众所周知，Python 是动态类型语言，运行时不需要指定变量类型。这一点是不会改变的，但是2015年9月创始人 Guido van Rossum 在 Python 3.5 引入了一个类型系统，允许开发者指定变量类型。它的主要作用是方便开发，供IDE 和各种开发工具使用，对代码运行不产生影响，运行时会过滤类型信息。</p><p>本文回顾了 Python 类型系统的现状，对它的优缺点进行了评价。</p><p>3、<a href="https://stackoverflow.com/questions/3310569/what-is-the-significance-of-1-1-1753-in-sql-server" target="_blank" rel="noreferrer">为什么 SQL Server 的日期从1753年1月1日开始？</a></p><p>原因是1752年英格兰进行了日历改革，由于日历算法的差异，导致丢失了9月3日到9月13日的一共12天。为了避免计算天数的误差，SQL Server 就索性把最小日期定为1753年1月1日，更大的日期范围由 datetime2 类型提供。</p><p>4、<a href="https://conanblog.me/Unix-as-IDE--Chinese-/index.html" target="_blank" rel="noreferrer">Unix 就是 IDE</a>（中文）</p><p>集成开发环境（IDE）作为文件结构、代码编写、代码维护、测试和排错工具于一体的应用程序，对程序员们非常有价值。这个教程展示如何用 Unix 命令行工具完成 IDE 的功能。</p><p>5、<a href="https://brianketelsen.com/web-assembly-and-go-a-look-to-the-future/" target="_blank" rel="noreferrer">Web Assembly 和 Go</a>（英文）</p><p>Go 1.11 将支持 Web Assembly，作者尝试用 Go 写了一个 TodoMVC。他的结论是：&quot;WebAssembly是 Web 开发的未来。两年后，Go、Swift、Rust 将占到前端代码的三分之一。</p><p>这里还有一篇<a href="https://blog.lazyhacker.com/2018/06/go-with-webassembly-early-examples.html" target="_blank" rel="noreferrer">文章</a>，展示了两个用 Go 语言写的 WebAssebmly demo。</p><p>6、<a href="https://letsencrypt.org/docs/certificates-for-localhost/" target="_blank" rel="noreferrer">如何生成 localhost 的证书？</a>（英文）</p><p>本地开发时，我们常常使用 localhost 访问本地服务，怎样才能生成证书，让 localhost 提供 https 服务呢？</p><p>7、<a href="https://yuanchuan.name/2018/05/06/unicode-patterns.html" target="_blank" rel="noreferrer">Unicode 字符与 CSS 背景</a>（英文）</p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071312.jpg" alt=""></p><p>Unicode 字符用作 CSS 背景，可以产生一些非常独特的背景。此文还有<a href="https://css-tricks.com/more-unicode-patterns/" target="_blank" rel="noreferrer">续篇</a>。</p><p>8、<a href="https://code.joejag.com/2016/anti-if-the-missing-patterns.html" target="_blank" rel="noreferrer">如果没有 if 语句</a>（英文）</p><p>一篇很有意思的文章，讨论如果不使用 if ... else 语句，应该怎么写代码。他的意思是，某些情况下 if 属于误用，会造成代码冗余或不利于阅读，这时应该减少 if 的使用。</p><p>9、<a href="https://cloud.tencent.com/developer/article/1100719" target="_blank" rel="noreferrer">国内最大的 DDOS 攻击</a>（中文）</p><p>4月8日，清明节后第一个工作日，腾讯云一个重要的棋牌游戏客户突然遭受大流量 DDoS 攻击，棋牌类游戏遭受攻击习以为常，但是本轮攻击流量峰值竟达到了1.23Tbps，刷新国内DDoS攻击最大流量记录。</p><h2 id="工具" tabindex="-1">工具 <a class="header-anchor" href="#工具" aria-label="Permalink to &quot;工具&quot;">​</a></h2><p>1、<a href="https://skia.org/" target="_blank" rel="noreferrer">Skia 图形库</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071313.jpg" alt=""></p><p>Skia 是一个由C++编写的开源图形库，能在低端设备如手机上呈现高品质的2D图形。截至2017年，它已被应用于 Mozilla Firefox、Google Chrome、Chrome OS、Sublime Text、Android、Flutter 框架，作为底层图形库。</p><p>2、<a href="https://a-jie.github.io/clock-shop/" target="_blank" rel="noreferrer">Clock Shop</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071329.jpg" alt=""></p><p>这个网站收集各种时钟的代码。</p><p>3、<a href="https://lifehacker.com/dim-your-browser-with-deluminate-for-google-chrome-1827295863" target="_blank" rel="noreferrer">Deluminate</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071314.jpg" alt=""></p><p>这是一个 Chrome 浏览器的插件，可以让任何网站变成&quot;夜晚模式&quot;。</p><p>4、<a href="https://github.com/nbedos/termtosvg" target="_blank" rel="noreferrer">termtosvg</a></p><p>你需要录制命令行操作吗？一般的做法是录制成视频，这个工具让你可以录制成 SVG 动画。</p><p>5、<a href="https://github.com/atlassian/react-beautiful-dnd" target="_blank" rel="noreferrer">react-beautiful-dnd</a></p><p>Atlassian 公司推出的 React 拖放操作的库。</p><p>6、<a href="https://github.com/danmacnish/cartoonify" target="_blank" rel="noreferrer">cartoonify</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071315.jpg" alt=""></p><p>今年的最有创意发明：自制的&quot;拍立得&quot;照相机，拍出来的不是照片，而是卡通图片！它的内部是摄像头+树莓派+热敏打印机。获得照片以后，自动调用谷歌的服务，处理成卡通图片，然后打印出来。</p><p>7、<a href="https://picheta.me/obfuscator" target="_blank" rel="noreferrer">C/C++ 混淆器</a></p><p>在线的混淆器工具（obfuscator），将 C/C++ 改成混淆难懂的代码。</p><p>8、<a href="https://github.com/rhysd/vim.wasm" target="_blank" rel="noreferrer">Vim in WebAssembly</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071316.jpg" alt=""></p><p>有人把 Vim 编译成了 WebAssembly，从而可以在浏览器里面使用 Vim 了。网友开玩笑，这样使用 Vim，就不会不知道如何退出了，只要点击浏览器 Tab 页右上角的 x 即可。</p><p>9、<a href="https://jaxenter.com/jib-java-containerization-146647.html" target="_blank" rel="noreferrer">Jib</a></p><p>谷歌开源的 Java 应用容器生成工具，不用写 Dockerfile，构造过程中自动生成一个 Docker 容器。</p><h2 id="资源" tabindex="-1">资源 <a class="header-anchor" href="#资源" aria-label="Permalink to &quot;资源&quot;">​</a></h2><p>1、<a href="https://github.com/dylanaraps/pure-bash-bible" target="_blank" rel="noreferrer">Bash 操作指南</a></p><p>收集各种 Bash 常用操作的仓库，比如分割字符串、倒转数组等等。</p><p>2、<a href="https://github.com/vipshop/vjtools" target="_blank" rel="noreferrer">vjtools</a></p><p>唯品会的 Java 编程规范。</p><p>3、<a href="https://blog.paralleldots.com/data-science/must-read-free-data-science-books/" target="_blank" rel="noreferrer">数据科学的必读免费书籍</a></p><p>网上有很多免费资源，这份书单是学习大数据的指南。</p><h2 id="文摘" tabindex="-1">文摘 <a class="header-anchor" href="#文摘" aria-label="Permalink to &quot;文摘&quot;">​</a></h2><p>1、<a href="http://blog.sina.com.cn/s/blog_4cd1c1670102xl27.html" target="_blank" rel="noreferrer">富士山攀登记</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071317.jpg" alt=""></p><p>我在15年前，一个人攀登上了富士山顶。日本有一个说法，说&quot;一个人如果一辈子不登一次富士山顶，是混蛋。如果登第二次，也是混蛋。&quot;这句话是说，不登一次富士山顶，是一生的遗憾。如果登二次，那一定是脑子进水了，因为登山的过程实在太艰辛。</p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071318.jpg" alt=""></p><p>富士山有多高，标准的高度是3775米。因为它频临太平洋，所以攀登富士山是从海拔1米开始攀登的。古代的时候，人们从山脚下开始攀登，到山顶，一般需要2天2夜的时间。现在大家开始偷懒，因为汽车可以开到半山腰的五合目。所以，攀登富士山顶，变成了从半山腰开始。半山腰的海拔高度，是在2000米左右。</p><p>......</p><p>经过一天的时间，我终于爬到了山顶，吃惊地发现，那里居然有一家小商店。</p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071319.jpg" alt=""></p><p>更吃惊的是，旁边有一个自动售货机。一瓶矿泉水，山下是130日元，到了山顶就是500日元。我都不知道，这个机器、这些饮料是怎么搬运到山顶上来的。</p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071320.jpg" alt=""></p><p>下山途中，发现了往山顶搬运货物的登山车，这才明白货物是怎么搬到山顶的。</p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071321.jpg" alt=""></p><p>2、<a href="https://www.allthingsdistributed.com/2006/11/working_backwards.html" target="_blank" rel="noreferrer">向后工作法</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071322.jpg" alt=""></p><p>亚马逊的 CTO 透露，他们采用&quot;向后工作法&quot;，开发一项产品采用下面的顺序。</p><blockquote><p>1、写新闻稿<br> 2、写 FAQ<br> 3、写用户文档<br> 4、写代码</p></blockquote><h2 id="新奇" tabindex="-1">新奇 <a class="header-anchor" href="#新奇" aria-label="Permalink to &quot;新奇&quot;">​</a></h2><p>1、<a href="https://en.wikipedia.org/wiki/Unexpected_hanging_paradox" target="_blank" rel="noreferrer">大吃一惊的逻辑题</a></p><p>国王对一个犯人说，下周一到周五的某一天，你会被绞死，但我不告诉你到底是哪一天，到时你肯定大吃一惊。</p><p>犯人分析后，认为自己不会死。首先不会在周五死，因为周四晚上能推断出次日的绞刑，所以不会大吃一惊。如果已知周五不会执行死刑，那么同理也可以推断出不会在周四死。以此类推，哪一天都不会死。</p><p>犯人因此觉得不用担心。但是就在星期三中午，士兵进来把他押到刑场执行死刑。犯人因此大吃一惊：&quot;我明明不应该在今天死啊！&quot;由于他认定自己不会死，所以实际上他任何一天都可能死，因为到时肯定大吃一惊。</p><p>2、<a href="http://www.excelunusual.com/" target="_blank" rel="noreferrer">ExcelUnusual.com</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071323.jpg" alt=""></p><p>Excel 不仅可以用来制作表格，还可以生成图形和动画。这个网站就收集各种奇特的 Excel 用法。</p><p>3、<a href="http://readerisdead.com/reader/view/" target="_blank" rel="noreferrer">Google Reader 怀旧版</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071324.jpg" alt=""></p><p>Google Reader 是谷歌的线上 RSS 阅读器，2013年关闭。现在，有人复制了一个一模一样的，让大家体验一下当年的感觉。</p><h2 id="本周图片" tabindex="-1">本周图片 <a class="header-anchor" href="#本周图片" aria-label="Permalink to &quot;本周图片&quot;">​</a></h2><p>1、<a href="http://eartharchitecture.org/?p=570" target="_blank" rel="noreferrer">冰坑</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071325.jpg" alt=""></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071326.jpg" alt=""></p><p>冰坑（Yakhchal）是古代波斯人储藏冰块的仓库，很多都保留了下来。地面的尖顶高达18米，地下的仓库有5000立方米。波斯人冬天把冰块放进去，夏天再拿出来用。沙漠地区能把冰块保存到夏天，是很了不起的。更了不起的是，最早的冰坑建于公元前400年。</p><p>2、<a href="https://en.wikipedia.org/wiki/Carcross_Desert" target="_blank" rel="noreferrer">世界最小的沙漠</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071327.jpg" alt=""></p><p>世界最小的沙漠是加拿大育空地区的 Carcross 沙漠，只有600米宽，几公里长。奇特的是，当地不缺水，植被也比较多。这个沙漠原来是一个湖泊，后来湖泊干涸了，湖底的淤泥就变成了沙漠。</p><p>3、<a href="https://cvdazzle.com/" target="_blank" rel="noreferrer">脸部识别失败的面孔</a></p><p><img src="https://www.wangbase.com/blogimg/asset/201807/bg2018071328.jpg" alt=""></p><p>这个网站研究哪些面孔会使得面部识别技术失败。</p><h2 id="本周金句" tabindex="-1">本周金句 <a class="header-anchor" href="#本周金句" aria-label="Permalink to &quot;本周金句&quot;">​</a></h2><p>1、</p><p>如果一件事情是手工完成，而不是机器自动化完成，那就是一个 bug。（<a href="https://queue.acm.org/detail.cfm?id=3197520" target="_blank" rel="noreferrer">来源</a>）</p><p>2、</p><p>海航集团创始人王健，曾经给员工讲过一堂课，内容是&quot;死去吧&quot;，经南方周末报道后广为流传。课程的中心内容很简单：管我要钱的时候我就让你们&quot;死去吧&quot;。</p><p>&quot;不要天天老盯着财务公司那点钱，要看到外面广阔的天地，纽约有上万亿美元，伦敦交易所、香港交易所有那么多钱。给你们发工资，你们永远成不了百万富翁，你们要去拿投资人的钱。&quot;（<a href="https://mp.weixin.qq.com/s/EUcfu0mGZdvGHsuyXFksOg" target="_blank" rel="noreferrer">来源</a>）</p><h2 id="欢迎订阅" tabindex="-1">欢迎订阅 <a class="header-anchor" href="#欢迎订阅" aria-label="Permalink to &quot;欢迎订阅&quot;">​</a></h2><p>这个专栏每周五发布，同步更新在我的<a href="http://www.ruanyifeng.com/blog" target="_blank" rel="noreferrer">个人网站</a>、<a href="http://weixin.sogou.com/weixin?query=%E9%98%AE%E4%B8%80%E5%B3%B0%E7%9A%84%E7%BD%91%E7%BB%9C%E6%97%A5%E5%BF%97" target="_blank" rel="noreferrer">微信公众号</a>和<a href="https://yuque.com/ruanyf/share/" target="_blank" rel="noreferrer">语雀</a>。</p><p>微信搜索&quot;<strong>阮一峰的网络日志</strong>&quot;或者扫描二维码，即可订阅。</p><p><img src="http://www.ruanyifeng.com/blogimg/asset/2018/bg2018042311.jpg" alt="image | left"></p><p>（完）</p>',145),s=[o];function l(n,g,i,h,c,b){return a(),t("div",null,s)}const f=e(p,[["render",l]]);export{w as __pageData,f as default};
